INSERT INTO `yoshikan_field_translation` VALUES (1,740,'[\"Welkom bij Judoclub Yoshi-Kan\"]','nl'),(2,737,'[\"<p>Judosport is één van de vele Olympische topsporten in ons land. Judo is de sport bij uitstek, om je zowel fysiek als mentaal te ontwikkelen. Met respect, zelfvertrouwen en discipline als belangrijkste peilers.</p>\\r\\n<p>Spelenderwijs leren kinderen een brede waaier aan valtechnieken, worpen en houdgrepen, leren ze omgaan met winst en verlies. Jongeren en volwassenen worden technisch begeleid. Dit alles in een ongedwongen clubsfeer, waar iedereen zich\\r\\nthuis voelt!</p>\"]','nl'),(3,741,'[\"Voor jong en oud\"]','nl'),(4,738,'[\"<p>Je kan in onze club terecht, voor zowel recreatief als competitief judo. Jongeren worden op respectvolle en verantwoorde\\r\\nwijze voorbereid en begeleid op wedstrijden, aangepast aan hun niveau.&nbsp;</p>\\r\\n<p>\\r\\nKom je liever voor het plezier? Ook daar hebben we oog voor! Aarzel niet en kom zeker eens proeven van 2 gratis\\r\\njudolessen.&nbsp;</p>\\r\\n<p><strong>\\r\\nJe bent van harte welkom!</strong></p>\"]','nl'),(5,736,'[true]','nl'),(6,739,'[\"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce nisi massa, pretium quis nisi id, dignissim luctus magna. Morbi suscipit eu magna a sollicitudin. Fusce aliquam gravida purus, quis maximus urna iaculis non. Nullam molestie odio ac sem mattis congue. Duis velit massa, finibus a lorem a, venenatis dictum urna.</p>\"]','nl'),(7,733,'{\"0\": \"\", \"alt\": \"\", \"media\": 3, \"filename\": \"beelden/stacks-image-94.jpg\"}','nl'),(8,734,'{\"0\": \"\", \"alt\": \"\", \"media\": 4, \"filename\": \"beelden/stacks-image-90.jpg\"}','nl'),(9,735,'{\"0\": \"\", \"alt\": \"\", \"media\": 2, \"filename\": \"beelden/stacks-image-92.jpg\"}','nl'),(10,732,'[\"homepage\"]','nl'),(11,744,'[\"404 Pagina niet gevonden.\"]','nl'),(12,743,'[\"<p>Oeps, de pagina die je zocht bestaat niet (meer).</p>\"]','nl'),(13,742,'[\"404-not-found\"]','nl'),(14,747,'[\"503 Website in onderhoud.\"]','nl'),(15,746,'[\"<p>We zijn even aan het werk aan deze website. Gelieve binnen enkele ogenblikken terug te komen.</p>\"]','nl'),(16,745,'[\"503-maintenance-mode\"]','nl'),(17,750,'[\"403 Forbidden\"]','nl'),(18,749,'[\"<p>Oeps, de pagina die je zocht is niet bereikbaar zonder eerst in te loggen.</p>\"]','nl'),(19,748,'[\"403-forbidden\"]','nl'),(20,753,'[\"Privacy Verklaring\"]','nl'),(21,752,'[\"<h5>\\r\\n    V1_08_08_2018\\r\\n</h5>\\r\\n<h3>\\r\\n    1. Algemeen\\r\\n</h3>\\r\\n<p>\\r\\n    Judoschool Yoshi-Kan vzw hecht veel waarde aan je privacy en de bescherming van je persoonsgegevens.<br>\\r\\n</p>\\r\\n<p>\\r\\n    In deze privacyverklaring willen we heldere en transparante informatie geven over hoe wij omgaan met\\r\\n    persoonsgegevens.\\r\\n    Wij doen er alles aan om je privacy te waarborgen en gaan daarom zorgvuldig om met persoonsgegevens. Judoschool\\r\\n    Yoshi-Kan vzw houdt zich in alle gevallen aan de toepasselijke wet- en regelgeving, waaronder de Algemene\\r\\n    Verordening Gegevensbescherming (ook gekend als GDPR).\\r\\n</p>\\r\\n<p>\\r\\n    Dit brengt met zich mee dat wij in ieder geval:\\r\\n</p>\\r\\n<ul>\\r\\n    <li>je persoonsgegevens verwerken in overeenstemming met het doel waarvoor deze zijn verstrekt, deze doelen en type\\r\\n        persoonsgegevens zijn beschreven in deze Privacyverklaring;\\r\\n    </li>\\r\\n    <li>verwerking van je persoonsgegevens beperkt is tot enkel die gegevens welke nodig zijn voor de doeleinden\\r\\n        waarvoor ze worden verwerkt;\\r\\n    </li>\\r\\n    <li>vragen om je uitdrukkelijke toestemming als wij deze nodig hebben voor de verwerking van je persoonsgegevens;\\r\\n    </li>\\r\\n    <li>passende technische en organisatorische maatregelen hebben genomen zodat de beveiliging van je persoonsgegevens\\r\\n        gewaarborgd is;\\r\\n    </li>\\r\\n    <li>geen persoonsgegevens doorgeven aan andere partijen, tenzij dit nodig is voor uitvoering van de doeleinden\\r\\n        waarvoor\\r\\n        ze zijn verstrekt;\\r\\n    </li>\\r\\n    <li>op de hoogte zijn van je rechten als betrokken persoon omtrent je persoonsgegevens, je hierop willen attent\\r\\n        maken\\r\\n        en deze willen respecteren.\\r\\n    </li>\\r\\n</ul>\\r\\n<p>\\r\\n    Als Judoschool Yoshi-Kan vzw zijn wij verantwoordelijk voor de verwerking van je persoonsgegevens. Indien je na het\\r\\n    doornemen\\r\\n    van onze privacyverklaring, of in algemenere zin, vragen heeft hierover of contact met ons wenst op te nemen\\r\\n    kan dit via onderstaande contactgegevens:\\r\\n</p>\\r\\n<p>\\r\\n    Judoschool Yoshi-Kan vzw\\r\\n</p>\\r\\n<p>\\r\\n    Zetel: Spekstraat 80, 2220 Heist op den Berg<br>Emailadres: judo.yoshikan@gmail.com<br>Telefoon: 0474/51.13.98\\r\\n</p>\\r\\n<p>\\r\\n    Website: <a href=\\\"http://www.yoshi-kan.be/contact/\\\">http://www.yoshi-kan.be/</a>\\r\\n</p>\\r\\n<h3>\\r\\n    2. Waarom verwerken wij persoonsgegevens?\\r\\n</h3>\\r\\n<p>\\r\\n    Je persoonsgegevens worden door Judoschool Yoshi-Kan vzw verwerkt ten behoeve van de volgende doeleinden en\\r\\n    rechtsgronden:\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Om te kunnen deelnemen aan de activiteiten van de Vlaamse Judofederatie (uitvoering overeenkomst)</li>\\r\\n    <li>Om te kunnen deelnemen aan de activiteiten van Judoschool Yoshi-Kan vzw (uitvoering overeenkomst)</li>\\r\\n    <li>Om te kunnen deelnemen aan de activiteiten van Sporta (uitvoering overeenkomst)</li>\\r\\n    <li>Voor het bekomen van subsidiëring door de overheid (wettelijke verplichting)</li>\\r\\n    <li>Voor verzekeringsdoeleinden (contractuele grond)</li>\\r\\n    <li>In het kader van de organisatie van sportpromotionele activiteiten (contractuele grond)</li>\\r\\n    <li>Het vastleggen van judoactiviteiten via foto en film voor PR-doeleinden (contractuele grond)</li>\\r\\n    <li>Het bijhouden van wedstrijd- en examenresultaten (gerechtvaardigd belang)</li>\\r\\n    <li>Het versturen van nieuwsbrieven en uitnodigingen (gerechtvaardigd belang)</li>\\r\\n    <li>In kader van de aanleg van het clubpatrimonium (gerechtvaardigd belang)</li>\\r\\n    <li>Voor publicitaire doeleinden (ledenblad, clubwebsite, facebookgroep,…..) (gerechtvaardigd belang,<br>toestemming)\\r\\n    </li>\\r\\n</ul>\\r\\n<h3>\\r\\n    3. Welke gegevens verwerken we?\\r\\n</h3>\\r\\n<p>\\r\\n    Voor de eerder opgesomde doelstellingen (zie hoofdstuk “Waarom verwerken wij persoonsgegevens”) kunnen wij de\\r\\n    volgende\\r\\n    persoonsgegevens van u vragen, opslaan, verzamelen en verwerken:\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Identificatiegegevens : naam, voornaam, adres, geslacht, GSM en/of telefoonnummer, e-mail</li>\\r\\n    <li>Rijksregisternummer</li>\\r\\n    <li>Persoonlijke kenmerken : geslacht, geboortedatum, judograad, gewicht (in geval van wedstrijddeelname)</li>\\r\\n</ul>\\r\\n<h3>\\r\\n    4. Wie verwerkt de gegevens?\\r\\n</h3>\\r\\n<p>\\r\\n    De gegevens worden verwerkt door volgende externe organisaties\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Bestuursleden van de vereniging</li>\\r\\n    <li>Vrijwilligers van de vereniging</li>\\r\\n    <li>De Vlaamse Judofederatie (VJF) vzw</li>\\r\\n    <li>Sporta</li>\\r\\n    <li>De verzekeringsmaatschappij: in geval van een schade aangifte wordt de verzekeringsmaatschappij van\\r\\n        deomstandigheden van het ongeval en de door de geneesheer gestelde diagnose ingelicht door de club. Het lid\\r\\n        dient eventuele bijkomende persoonlijke gegevens op vraag van de verzekeringsmaatschappij rechtstreeks te\\r\\n        bezorgen.\\r\\n    </li>\\r\\n</ul>\\r\\n<h3>\\r\\n    5. Verstrekking aan derden\\r\\n</h3>\\r\\n<p>\\r\\n    De gegevens die je aan ons geeft kunnen wij aan derde partijen verstrekken indien dit noodzakelijk is voor\\r\\n    uitvoering van de hierboven beschreven doeleinden.\\r\\n</p>\\r\\n<p>\\r\\n    Zo maken wij gebruik van een derde partij (verwerker) voor:\\r\\n</p>\\r\\n<ul>\\r\\n    <li>het verzorgen van de internet omgeving (webhosting);</li>\\r\\n    <li>het verzorgen van een website en/of Facebook (content)</li>\\r\\n    <li>het verzorgen van IT-infrastructuur (o.a. IT netwerk, …);</li>\\r\\n    <li>het verzorgen (en verspreiden) van nieuwsbrieven en uitnodigingen.</li>\\r\\n</ul>\\r\\n<p>\\r\\n    Wij geven nooit persoonsgegevens door aan verwerkers (andere partijen) dan diegene waarmee we een<br>verwerkersovereenkomst\\r\\n    hebben afgesloten. Met deze partijen (verwerkers) maken wij hierin uiteraard de nodige afspraken om de\\r\\n    beveiliging van je persoonsgegevens te waarborgen.\\r\\n</p>\\r\\n<p>\\r\\n    Verder zullen wij de verstrekte gegevens niet aan derden doorgeven tenzij dit wettelijk verplicht en/of toegestaan\\r\\n    is, zoals bv. in het kader van een politioneel of gerechtelijk onderzoek.\\r\\n</p>\\r\\n<p>\\r\\n    Tevens kunnen wij persoonsgegevens delen met derden indien je ons hier toestemming voor geeft. Deze toestemming kan\\r\\n    ten allen tijde ingetrokken worden, zonder dat dit afbreuk doet aan de rechtmatigheid van de verwerking voor de\\r\\n    intrekking\\r\\n    daarvan.\\r\\n</p>\\r\\n<p>\\r\\n    Wij verstrekken geen persoonsgegevens aan partijen die gevestigd zijn buiten de EU.\\r\\n</p>\\r\\n<h3>\\r\\n    6. Beveiliging van de gegevens\\r\\n</h3>\\r\\n<p>\\r\\n    Volgende passende technische en organisatorische maatregelen zijn genomen om persoonsgegevens te beschermen tegen\\r\\n    onrechtmatige verwerking:\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Alle personen die namens Yoshi-Kan vzw van je gegevens kennis kunnen nemen, zijn gehouden aan geheimhouding\\r\\n        daarvan.\\r\\n    </li>\\r\\n    <li>We hanteren een gebruikersnaam en wachtwoordbeleid op al onze systemen;</li>\\r\\n    <li>We zorgen voor de encryptie van persoonsgegevens als daar aanleiding toe is;</li>\\r\\n    <li>Wij maken back-ups van de persoonsgegevens om deze te kunnen herstellen bij fysieke of technische incidenten;\\r\\n    </li>\\r\\n    <li>We testen en evalueren regelmatig onze maatregelen;</li>\\r\\n    <li>Onze medewerkers zijn geïnformeerd over het belang van de bescherming van persoonsgegevens.</li>\\r\\n</ul>\\r\\n<h3>\\r\\n    7. Je rechten omtrent je gegevens\\r\\n</h3>\\r\\n<p>\\r\\n    Je hebt recht op inzage, kopie, aanpassing of het wissen van de persoonsgegevens die wij ontvangen hebben. Via het\\r\\n    hoger\\r\\n    vermeld adres kun je hier ons hiervoor contacteren.\\r\\n</p>\\r\\n<p>\\r\\n    Om misbruik te voorkomen kunnen wij je daarbij vragen om u adequaat te identificeren. Dit kan bij afspraak gebeuren\\r\\n    tijdens\\r\\n    de judotraining in onze dojo. Wij vragen jou om hiervoor jouw identiteit mee te brengen naar de dojo. Dit kan ook\\r\\n    via\\r\\n    de website (e-mail). Om hierbij jouw identiteit te controleren vragen wij jou om een kopie van jouw identiteitskaart\\r\\n    mee te sturen.\\r\\n</p>\\r\\n<p>\\r\\n    Ook heb je het recht om de verstrekte gegevens door ons te laten overdragen aan jezelf of in jouw opdracht direct\\r\\n    aan een andere partij. Wij kunnen je vragen om je te legitimeren voordat wij gehoor kunnen geven aan voornoemde\\r\\n    verzoeken.\\r\\n</p>\\r\\n<h3>\\r\\n    8. Klachten\\r\\n</h3>\\r\\n<p>\\r\\n    Mocht je een klacht hebben over de verwerking van je persoonsgegevens dan vragen wij je hierover direct contact met\\r\\n    ons\\r\\n    op te nemen.\\r\\n</p>\\r\\n<p>\\r\\n    Je hebt altijd het recht een klacht in te dienen bij de Gegevensbeschermingsautoriteit (GBA); dit is de <br>toezichthoudende\\r\\n    autoriteit op het gebied van privacy bescherming.\\r\\n</p>\\r\\n<p>\\r\\n    Drukpersstraat 35<br>1000 Brussel<a href=\\\"https://www.gegevensbeschermingsautoriteit.be\\\" target=\\\"_blank\\\"><br>https://www.gegevensbeschermingsautoriteit.be</a>\\r\\n</p>\\r\\n<h3>\\r\\n    9. Wijziging privacyverklaring\\r\\n</h3>\\r\\n<p>\\r\\n    Yoshi-Kan vzw kan haar privacy statement steeds wijzigen. Van deze wijziging zullen we steeds een aankondiging\\r\\n    doen op onze website. De laatste wijziging gebeurde op 8/8/18. Oudere versies van ons privacy statement zullen\\r\\n    in ons archief worden opgeslagen. Stuur ons een e-mail als u deze wilt raadplegen.\\r\\n</p>\\r\\n\"]','nl'),(22,751,'[\"privacy-verklaring\"]','nl'),(23,756,'[\"Online inschrijven.\"]','nl'),(24,755,'[\"<p><em>\\r\\n&nbsp;[inschrijving_placeholder]</em>. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce nisi \\r\\nmassa, pretium quis nisi id, dignissim luctus magna. Morbi suscipit eu \\r\\nmagna a sollicitudin. Fusce aliquam gravida purus, quis maximus urna \\r\\niaculis non. Nullam molestie odio ac sem mattis congue. Duis velit \\r\\nmassa, finibus a lorem a, venenatis dictum urna.</p>\"]','nl'),(25,754,'[\"online\"]','nl'),(26,760,'[\"Karin Belmans\"]','nl'),(27,761,'[\"1960\"]','nl'),(28,762,'[\"\"]','nl'),(29,759,'[\"<p>Startte met judo op de leeftijd van 12 jaar in Keerbergen. Werd zwarte gordel in 1979 en behaalde de 2e Dan in 1986. Vanaf 1979 startte zij met lesgeven in de club van Keerbergen en op 1 januari&nbsp;1996 richtte ze haar eigen judoschool “ Yoshi-Kan” op. Dit doet ze momenteel met 34 jaar ervaring en gedrevenheid.<br><br>Karin neemt de 5 tot 12 jarigen onder haar hoede. Door het hanteren van vele spelvormen en beeldspraak, brengt zij hen een mooie basis van het judo bij en zorgt ze ervoor dat de kinderen zich, als een vis in het water thuis voelen op de tatami!</p>\"]','nl'),(30,758,'{\"0\": \"\", \"alt\": \"\", \"media\": 10, \"filename\": \"trainers/karin.jpg\"}','nl'),(31,757,'[\"karin-belmans\"]','nl'),(32,766,'[\"Koen Staquet\"]','nl'),(33,767,'[\"1965\"]','nl'),(34,768,'[\"\"]','nl'),(35,765,'[\"<p>Startte met judo op de leeftijd van 11 jaar in Heist op den Berg.&nbsp;Hij werd zwarte gordel in 1987 en is trainer A sinds 2002. In 2011 behaalde hij de graad van 5e Dan. Koen begeleidt met passie de +12 jarigen en volwassenen naar een hoger niveau en stoomt elke judoka klaar voor het behalen van de zwarte gordel : 1e, 2e, 3e of 4e Dan.<br><br>Jeugd die graag aan competitie doet, ziet hij als een uitdaging. Maar ook de recreant verliest hij niet uit het oog! Cursussen, bijscholingen of katatrainingen: niets gaat aan hem voorbij.</p>\"]','nl'),(36,764,'{\"0\": \"\", \"alt\": \"\", \"media\": 9, \"filename\": \"trainers/koen.jpg\"}','nl'),(37,763,'[\"koen-staquet\"]','nl'),(38,772,'[\"Cynthia Rosseneu\"]','nl'),(39,773,'[\"1991\"]','nl'),(40,774,'[\"judo.yoshikan@gmail.com\"]','nl'),(41,771,'[\"<p>Jeugdsportcoördinator.&nbsp;Cynthia startte met judo op de leeftijd van 5 jaar bij judoschool Yoshi-Kan. Aanvankelijk bij Karin en tot op heden bij Koen. Zij behaalde meermaals het Belgische podium, maar een internationale judocarrière liet ze staan, voor haar studies Master of Science LO en bewegingswetenschappen aan de VUB te Brussel.&nbsp;</p>\\r\\n<p>In 2007 werd zij zwarte gordel en behaalde de 4e Dan in 2017. Zij is eveneens sinds juni 2013, trainer A. Ze geeft met evenveel elan les in onze judoschool en neemt ook de kinderen die graag aan competitie doen onder haar hoede. Ze begeleidt hen als coach op vele wedstrijden. Teamspirit is dan ook haar tweede naam! Cynthia kan je volgen via <a href=\\\"http://www.judoinside.com/judoka/view/43784/\\\" rel=\\\"external\\\" target=\\\"_blank\\\">JudoInside</a>.</p>\"]','nl'),(42,770,'{\"0\": \"\", \"alt\": \"\", \"media\": 8, \"filename\": \"trainers/cynthia.jpg\"}','nl'),(43,769,'[\"cynthia-rosseneu\"]','nl'),(44,778,'[\"Amelie Rosseneu\"]','nl'),(45,779,'[\"1998\"]','nl'),(46,780,'[\"\"]','nl'),(47,777,'[\"<p>Startte met judo op de leeftijd van 6 jaar bij judoschool Yoshi-Kan. Aanvankelijk bij Karin en tot op heden bij Koen. Zij werd reeds 8x belgisch Kampioene (3x bij de juniors en 5x bij de seniors) Amelie is tevens trainer B sinds 2012 en behaalde de graad van 3e Dan in 2011. Reeds op jonge leeftijd koos zij voor het topsport-statuut en voor een internationale judocarrière, waar zij tot op heden met grote gedrevenheid aan werkt en prachtige resultaten boekt.&nbsp;</p>\\r\\n<p>Tevens studeerde zij als diëtiste af in 2011 en startte haar praktijk. Sportlui maar ook andere mensen, begeleidt ze uit eigen ervaring naar de gewenste resultaten. Je kan haar volgen via haar <a href=\\\"http://www.amelierosseneu.be/\\\" rel=\\\"self\\\">website</a>, <a href=\\\"http://www.judoinside.com/judoka/view/29395/\\\" rel=\\\"external\\\" target=\\\"_blank\\\">JudoInside</a> en eveneens via Facebook.</p>\"]','nl'),(48,776,'{\"0\": \"\", \"alt\": \"\", \"media\": 7, \"filename\": \"trainers/amelie.jpg\"}','nl'),(49,775,'[\"amelie-rosseneu\"]','nl'),(50,784,'[\"Evi Vermandere\"]','nl'),(51,785,'[\"1995\"]','nl'),(52,786,'[\"\"]','nl'),(53,783,'[\"<p>Startte met judo op de leeftijd van 5 jaar bij judoschool Yoshi-Kan. Net zoals de anderen, aanvankelijk bij Karin, later bij Koen. Al snel bleek dat zij zeer talentvol was en werd tot op heden 5x Belgisch Kampioene (2x bij de kadetten, 2x bij de beloften en 1x bij de junioren).<br><br>Ook zij ambieert een internationale carrière, waar wij ten volle achter staan en waar zij mooie resultaten pakt. Zij werd zwarte gordel in 2011 en werd in 2012 reeds 2e Dan. Evi kan je volgen via <a href=\\\"http://www.judoinside.com/judoka/view/48814/\\\" rel=\\\"external\\\" target=\\\"_blank\\\">JudoInside</a> en Facebook.</p>\"]','nl'),(54,782,'{\"0\": \"\", \"alt\": \"\", \"media\": 6, \"filename\": \"trainers/evi.jpg\"}','nl'),(55,781,'[\"evi-vermandere\"]','nl'),(56,790,'[\"Elke Vermandere\"]','nl'),(57,791,'[\"1993\"]','nl'),(58,792,'[\"\"]','nl'),(59,789,'[\"<p>Startte met judo op de leeftijd van 6 jaar bij judoschool Yoshi-Kan. Haar interesse en oog voor detail waren zeer groot en ze werd bijgevolg 2x Belgisch Kampioene (1x bij de cadetten en 1x bij de beloften). In 2010 werd zij zwarte gordel. Elke is net als haar zus te volgen via <a href=\\\"http://www.judoinside.com/judoka/view/45188/\\\" rel=\\\"external\\\" target=\\\"_blank\\\">JudoInside</a>.</p>\"]','nl'),(60,788,'{\"0\": \"\", \"alt\": \"Elke Vermandere\", \"media\": 5, \"filename\": \"trainers/elke.jpg\"}','nl'),(61,787,'[\"elke-vermandere\"]','nl'),(62,793,'[\"1\"]','nl'),(63,794,'[\"2\"]','nl'),(64,795,'[\"6\"]','nl'),(65,796,'[\"5\"]','nl'),(66,797,'[\"4\"]','nl'),(67,798,'[\"3\"]','nl'),(68,803,'[\"1\"]','nl'),(69,802,'[\"Hofstade\"]','nl'),(70,800,'[\"<p><strong>Sport Vlaanderen Hofstade</strong></p>\\r\\n<p><strong></strong>Sportcomplex<br>Tervuursesteenweg 400<br>1981 Hofstade (Zemst)</p>\\r\\n<p><a href=\\\"https://www.sport.vlaanderen/waar-sporten/onze-centra/sport-vlaanderen-hofstade/accommodaties/indoor-sportaccommodaties/\\\" target=\\\"_blank\\\">Website</a></p>\"]','nl'),(71,801,'[\"<table><tbody><tr><td>groep&nbsp;<strong>4-7j.&nbsp;</strong></td><td>woe. 14-15u</td><td>za. 14-15u</td></tr><tr><td>groep <strong>8-12j.</strong></td><td>woe. 15-16u</td><td>za. 15u-16u</td></tr><tr><td>groep <strong>13-99j.</strong></td><td>woe. 16-17u</td><td>za. 16u-17u</td></tr></tbody></table>\\r\\n<p>Geen trainingen tijdens de schoolvakanties.</p>\"]','nl'),(72,799,'[\"hofstade\"]','nl'),(73,808,'[\"2\"]','nl'),(74,807,'[\"Haacht\"]','nl'),(75,805,'[\"<p><strong>Sporthal Den Dijk</strong><br>Gevechtsportszaal</p>\\r\\n<p>Dijkstraat 1<br>3150 Haacht</p>\\r\\n<p><a href=\\\"https://www.haacht.be/dendijk\\\" target=\\\"_blank\\\">Website</a></p>\"]','nl'),(76,806,'[\"\"]','nl'),(77,804,'[\"haacht\"]','nl'),(78,813,'[\"3\"]','nl'),(79,812,'[\"Heist op den Berg\"]','nl'),(80,810,'[\"\"]','nl'),(81,811,'[\"\"]','nl'),(82,809,'[\"heist-op-den-berg\"]','nl'),(83,818,'[\"Onze missie\"]','nl'),(84,817,'[\"<p>Spelenderwijs leren kinderen een brede waaier aan valtechnieken, worpen en houdgrepen, leren ze omgaan met winst en verlies. Jongeren en volwassenen worden technisch begeleid. Dit alles in een ongedwongen clubsfeer, waar iedereen zich thuis voelt! </p>\\r\\n<p>Je kan in onze club terecht, voor zowel recreatief als competitief judo. Jongeren worden op respectvolle en verantwoorde wijze voorbereid en begeleid op wedstrijden, aangepast aan hun niveau. </p>\\r\\n<p>Kom je liever voor het plezier? Ook daar hebben we oog voor! </p>\\r\\n<p>Naast het bovenstaande is het onze missie om onze leden een zo goed mogelijke begeleiding te geven op eender welke leeftijd. Op die manier vermijden we drop-outs en wordt de judosport uiteindelijk een deel van hen zelf, een vanzelfsprekend iets. De vriendschap en kameraadschap die in onze club heerst en de spontane vrijwillige hulp van leden en ouders bij het organiseren van verschillende nevenactiviteiten maakt onze judoschool tot een toffe club waar het fijn is om deel van uit te maken. </p>\\r\\n<p>In 2021 vierden we ook ons 25 jarig bestaan.</p>\"]','nl'),(85,816,'[\"<p><br></p>\"]','nl'),(86,815,'[\"onze-missie\"]','nl'),(87,814,'[\"page_single_column.twig\"]','nl'),(88,819,'{\"0\": \"\", \"alt\": \"Onze missie.\", \"media\": 16, \"filename\": \"banners/banner-3.jpg\"}','nl'),(89,825,'[\"Onze visie\"]','nl'),(90,824,'[\"<div><p>Voor de toekomst willen we zeer graag verder gaan met onze enthousiaste medewerkers. We streven naar nog meer opleiding van kandidaat-trainers en begeleiden stageprojecten vanuit de school. Zo alleen kunnen we de stijgende groei van onze judoschool verzekeren en kwalitatieve trainingen aanbieden met oog voor alle leden, klein en groot, topatleet en recreant. Deze pedagogische taak blijven we zeer ter harte nemen, met respect voor iedereen.&nbsp;</p>\\r\\n<p>Op sociaal vlak moet er nog meer ruimte komen voor nevenactiviteiten. Het jaarlijks judofeest met clubtornooi en bbq, de ardennenwandeling met bbq op het einde van het seizoen, kunnen we nog verder uitbreiden met een aantal nieuwe suggesties die we aan al onze leden tot vraag stelden. Feedback en respons is van groot belang.&nbsp;</p>\\r\\n<p>Zo kunnen onze leden al hun nieuws, wensen en feedback kwijt op onze gesloten Yoshi-Kan Facebook groep. Zeer leuk om op de hoogte te blijven wat er zoal reilt en zeilt in onze club!</p></div>\"]','nl'),(91,823,'[\"<p><br></p>\"]','nl'),(92,822,'{\"0\": \"\", \"alt\": \"\", \"media\": 14, \"filename\": \"banners/banner-5.jpg\"}','nl'),(93,821,'[\"onze-visie\"]','nl'),(94,820,'[\"page_single_column.twig\"]','nl'),(95,831,'[\"Contact\"]','nl'),(96,830,'[\"<p>Inschrijven kan altijd tijdens de normale uren van de judolessen. </p>\\r\\n<p>Aangezien het uitgebreid aanbod aan lessen, leeftijdscategorieën en locaties, gelieve voor verdere info i.v.m. onze trainingen een mail te sturen naar:&nbsp;<a href=\\\"mailto:%20judo.yoshikan@gmail.com\\\">judo.yoshikan@gmail.com&nbsp;</a></p>\\r\\n<p><a href=\\\"mailto:%20judo.yoshikan@gmail.com\\\"></a>Telefonisch contact kan ook : GSM 0474/51 13 98</p>\\r\\n<p>Wil je iets op onze site laten publiceren? Contacteer dan:&nbsp;<a href=\\\"mailto:%20webmaster@yoshi-kan.be\\\">[</a>webmaster]</p>\"]','nl'),(97,829,'[\"\"]','nl'),(98,828,'{\"0\": \"\", \"alt\": \"\", \"media\": 16, \"filename\": \"banners/banner-3.jpg\"}','nl'),(99,827,'[\"contact\"]','nl'),(100,826,'[\"page_single_column.twig\"]','nl'),(101,837,'[\"Handige Links\"]','nl'),(102,836,'[\"<p><a href=\\\"http://www.vjf.be/\\\" target=\\\"_blank\\\">VJF</a><br>Site van de Federatie met info i.v.m. wedstrijden, trainingen, enz...</p><p><a href=\\\"http://www.eju.net/\\\" target=\\\"_blank\\\">Europese Judo Federatie</a><br>Volg onze topjudoka\'s via deze site</p><p><a href=\\\"http://www.intjudo.eu/\\\" target=\\\"_blank\\\">Internationale Judo Federatie</a><br>Top Judo... ook buiten Europa!</p>\"]','nl'),(103,835,'[\"\"]','nl'),(104,834,'{\"0\": \"\", \"alt\": \"\", \"media\": 15, \"filename\": \"banners/banner-4.jpg\"}','nl'),(105,833,'[\"links\"]','nl'),(106,832,'[\"page_single_column.twig\"]','nl'),(107,843,'[\"Sponsors\"]','nl'),(108,842,'[\"<p>[sponsors]</p>\"]','nl'),(109,841,'[\"\"]','nl'),(110,840,'{\"0\": \"\", \"alt\": \"\", \"media\": 13, \"filename\": \"banners/banner-6.jpg\"}','nl'),(111,839,'[\"sponsors\"]','nl'),(112,838,'[\"page_single_column.twig\"]','nl'),(113,849,'[\"Lessenschema\"]','nl'),(114,848,'[\"<p>Onze lessen vinden plaats in Hofstade, Haacht, Heist op den Berg en Herselt.<br>Het is mogelijk om per week op meerdere locaties judoles te volgen in 3 leeftijdsgroepen: 4-7j / 8-12j / 13-99j</p><p>Voor het grote aanbod aan lesdagen en lesuren, gelieve ons een mailtje te sturen naar:&nbsp;<a href=\\\"mailto:judo.yoshikan@gmail.com\\\">judo.yoshikan@gmail.com</a>&nbsp;met vermelding van de gekozen leslocatie(s) en leeftijd van de startende judoka.</p>\"]','nl'),(115,847,'[\"<p><br></p>\"]','nl'),(116,846,'{\"0\": \"\", \"alt\": \"\", \"media\": 15, \"filename\": \"banners/banner-4.jpg\"}','nl'),(117,845,'[\"lessenschema\"]','nl'),(118,844,'[\"page_single_column.twig\"]','nl'),(119,855,'[\"Opleidingsplan jeugd\"]','nl'),(120,854,'[\"<p>Alle jonge judoka’s worden opgesplitst in drie groepen volgens leeftijd:</p>\\r\\n<ul><li>Groep 1: <b>4-7 jaar</b></li><li>Groep 2: <b>8-12 jaar</b></li><li>Groep 3: <b>13+</b></li></ul>\\r\\n<p>Alle judoka’s vanaf de leeftijd van 6 jaar worden gestimuleerd om op regelmatige basis (5 à 6 maal per jaar) deel te nemen aan jeugdtornooien onder begeleiding en coaching van hun trainers. Vermits dit vaak stimulerend werkt om op trainingen beter te presteren.<strong><br></strong></p>\\r\\n<p><strong>Opleidingsplan groep 1:<br></strong></p>\\r\\n<p>Beperkte Japanse terminologie:</p><ul><li>Al spelenderwijs leren de kinderen de belangrijkste Japanse woordenschat zoals : hajime (start), matte (stop), re (groeten), ukemi (vallen), osai-komi (houdgreep), enz.</li><li>Namen van technieken worden met beeldspraak verduidelijkt zoals: slang rond de boom, schuif af houdgreep, enz.<br></li></ul>\\r\\n<p>Aanleren technieken:</p><ul><li>Met veel beeldspraak, variatie, en al spelenderwijs worden de verschillende technieken aangeleerd.</li><li>Gekende spelen (1, 2, 3, piano; tikkertje; enz.) worden omgevormd naar dezelfde spelen maar met specifieke judotechnieken.<br></li></ul>\\r\\n<p>Aanbod:</p><ul><li>Grote variatie in aangeboden technieken rechtstaande en op grond.<br></li></ul>\\r\\n<p>Verhogen van gordel:</p><ul><li>Om de motivatie bij de kinderen te stimuleren wordt er telkens na een aantal lessen een mini test afgenomen. Hiervoor krijgen ze een streepje op hun gordel. Na vijf streepjes mogen de kinderen hun test naar de volgende gordel afleggen. Zodoende hebben ze alle technieken al eens uitgevoerd in kleine stappen. Dit vergemakkelijkt het examen naar de volgende gordel. De kinderen worden uiteraard nog gestuurd naar de juiste uitvoering van hun technieken.<br><strong><br></strong></li></ul>\\r\\n<p><strong>Opleidingsplan groep 2 + 3:<br></strong></p>\\r\\n<p>Japanse terminologie:</p>\\r\\n<ul><li>Er wordt verwacht dat de judoka’s alle technieken met hun Japanse benaming kennen alsook de basis terminologie.</li></ul>\\r\\n<p>Aanleren technieken:</p>\\r\\n<ul><li>Het technisch aan te leren pakket is uitgebreider.</li><li>De technieken worden gedetailleerder uitgelegd.</li><li>Er wordt nog beeldspraak gebruikt maar in mindere mate.</li><li>Schakeltechnieken en overnametechnieken zowel rechtstaande als op grond worden aangeleerd.</li><li>Wedstrijden komen in deze groep frequenter voor, met oog op veel variatie van de aangeleerde technieken.</li></ul>\\r\\n<p>Verhogen van gordel:</p>\\r\\n<ul><li>Om de motivatie bij de kinderen te stimuleren wordt er telkens na een aantal lessen een mini test afgenomen. Hiervoor krijgen ze een streepje op hun gordel. Na vijf streepjes (-10 jaar) of drie streepjes (+10 jaar) mogen de kinderen hun test naar de volgende gordel afleggen. Zodoende hebben ze alle technieken al eens uitgevoerd in kleine stappen. </li></ul>\\r\\n<p>Dit vergemakkelijkt het examen naar de volgende gordel. De kinderen worden uiteraard nog gestuurd naar de juiste uitvoering van hun technieken, doch wordt van hen verwacht de juiste naam bij de juiste techniek te kennen en te kunnen uitvoeren.</p>\"]','nl'),(121,853,'[\"<p><br></p>\"]','nl'),(122,852,'{\"0\": \"\", \"alt\": \"\", \"media\": 15, \"filename\": \"banners/banner-4.jpg\"}','nl'),(123,851,'[\"opleidingsplan-jeugd\"]','nl'),(124,850,'[\"page_single_column.twig\"]','nl'),(125,861,'[\"Tarieven\"]','nl'),(126,860,'[\"<p>Jaarlijks lidgeld voor 2 trainingen per week:<b> 260€</b><br>2e en 3e kind van éénzelfde familie geniet 10% korting : <b>234€</b></p>\\r\\n<p>Jaarlijks lidgeld voor 1 training per week : <b>205€</b><br>2e en 3e kind van éénzelfde familie geniet 10% korting : <b>185€</b></p>\\r\\n<p>Halfjaarlijks lidgeld voor 2 trainingen per week: <b>155€</b><br>2e en 3e kind van éénzelfde familie geniet 10% korting : <b>140€&nbsp;</b></p>\\r\\n<p>Halfjaarlijkse lidgeld voor 1 training per week : <b>130€&nbsp;</b><br>2e en 3e kind van éénzelfde familie geniet 10% korting : <b>117€&nbsp;</b></p>\\r\\n<p>Voor 3 tot 5 trainingen per week betaal je een supplement van <b>50€</b> op jaarbasis.<br></p>\\r\\n<p>Inschrijvingspakket (éénmalig te betalen bij inschrijving) :<b><br>10€</b> voor judogids, judopaspoort, leskaart + sportzak voor judopak.<br></p>\\r\\n<p>Judopak + gordel: 25 tot 40 euro (prijs afhankelijk van de gekozen maat)</p>\"]','nl'),(127,859,'[\"<p><br></p>\"]','nl'),(128,858,'{\"0\": \"\", \"alt\": \"\", \"media\": 15, \"filename\": \"banners/banner-4.jpg\"}','nl'),(129,857,'[\"tarieven\"]','nl'),(130,856,'[\"page_single_column.twig\"]','nl'),(131,867,'[\"Reglement\"]','nl'),(132,866,'[\"<p>\\r\\n    <strong>Aansluiting + inschrijving<br></strong><br>Door het betalen van het lidgeld gaan de judoka’s en de ouders akkoord met het intern reglement. Het lidgeld dient, onafgezien van het aantal afwezigheden (ernstige ziekte uitgesloten) voor een volledig sportjaar betaald te worden, hetzij per jaar, hetzij per half jaar. En dit na de twee eerste gratis proeflessen.<br>\\r\\n</p>\\r\\n<p>\\r\\n    <strong>Jeugdleden<br></strong>\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Gebruik de aangeleerde vechttechnieken enkel in de club, en nooit daarbuiten.</li>\\r\\n    <li>Heb respect voor jezelf, je medesporter, je tegenstanders, je trainer, het clubbestuur, de scheidsrechter, de juryleden, de toeschouwers, het materiaal waar je mee omgaat en de accommodatie waar je sport.</li>\\r\\n    <li>Kamp volgens de afgesproken regels en aanvaard de beslissingen van scheidsrechters, juryleden en toezichthoudende arts.</li>\\r\\n    <li>Draag zorg voor je eigen veiligheid en die van je medesporters door het verzorgen van je persoonlijke hygiëne (gewassen, nagels van handen en voeten kort houden, proper gewassen judopak zonder scheuren of gaten) en geen potentieel kwetsend materiaal dragen (horloges, sieraden, juwelen…).</li>\\r\\n    <li>Wees sportief tegenover je tegenstander, ook al toont deze onsportief gedrag.</li>\\r\\n    <li>De trainingen die bezig zijn niet storen.</li>\\r\\n    <li>Bij het betreden of het verlaten van de judomat, zal er steeds op een kalme en waardige manier worden gegroet.</li>\\r\\n    <li>Om de judoles voor het einde te mogen verlaten, vraagt men steeds toestemming aan de lesgever/trainer, voor de aanvang van de les.</li>\\r\\n   <li>Om de mat, voor gelijk welke reden, te mogen verlaten, vraagt men toelating aan de lesgever/trainer.</li>\\r\\n    <li>Als men te laat op de les komt, zal men de trainer gaan groeten om zich te verontschuldigen.</li>\\r\\n    <li>Het is verboden snoepgoed of kauwgom te eten op de judomat.</li>\\r\\n</ul>\\r\\n<p>\\r\\n    <strong>Trainers/coaches</strong>\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Pas het materiaal en de trainingsinhouden aan zodat sparring gebeurt met gelijkwaardige sporters, zowel qua niveau, gewicht als leeftijd.<br>Wees er je van bewust dat je als trainer/coach een voorbeeldfunctie hebt en verantwoordelijk bent voor wat je aanbrengt.</li>\\r\\n    <li>Wijs je sporters op het belang van veiligheid door het verbieden van het dragen van potentieel kwetsend materiaal (sieraden, horloges, …) en creër veilige trainingsomstandigheden.</li>\\r\\n    <li>Als trainer/coach ben je verantwoordelijk voor het aanleren van de sport én voor het gedrag van de sporter tijdens de training/wedstrijd. Besteed aan beide aspecten voldoende aandacht een neem je verantwoordelijkheid hierin op.</li>\\r\\n    <li>Reageer correct op onaangepast gedrag.</li>\\r\\n    <li>Laat de veiligheid en gezondheid van je sporters primeren op de sportieve prestaties door voldoende veiligheidsmaatregelen te nemen.</li>\\r\\n    <li>Respecteer steeds de beslissingen van scheidsrechters, juryleden en toezichthoudende arts en breng dit over op alle sporters.</li>\\r\\n</ul>\\r\\n<p>\\r\\n    <strong>Ouders<br></strong>\\r\\n</p>\\r\\n<ul>\\r\\n    <li>Supporter positief op wedstrijden door je kind aan te moedigen, te applaudisseren en enthousiast te zijn, ook als het minder gaat. Positieve stimulans is van groot belang.</li>\\r\\n    <li>Laat het coachen over aan de wedstrijdbegeleider en het trainen aan de trainer.</li>\\r\\n    <li>Wees er bewust van dat de sport onmogelijk zou zijn zonder scheidsrechters, juryleden, tegenstanders, trainers of trainingspartners.</li>\\r\\n    <li>Respecteer de beslissingen van de scheidsrechters, juryleden en toezichthoudende arts.</li>\\r\\n    <li>Leer je kind om de regels van de sport na te leven en de regels van de fair play in acht te nemen. Reageer op onaangepast gedrag.</li>\\r\\n    <li>Zie er op toe dat je kind de aangeleerde technieken enkel in de club gebruikt, en nooit daarbuiten.</li>\\r\\n    <li>Zie toe op de persoonlijke hygiëne van je eigen kind.</li>\\r\\n    <li>Gelieve allerhande juwelen bij je kind uit te doen alvorens het de mat betreedt.</li>\\r\\n    <li>Bij het kijken naar de trainingen, gelieve het zaalreglement te respecteren.</li>\\r\\n    <li>Gelieve, indien men de trainingen bijwoont, dit in stilte te doen en de judomat niet te betreden.</li>\\r\\n</ul>\"]','nl'),(133,865,'[\"\"]','nl'),(134,864,'{\"0\": \"\", \"alt\": \"\", \"media\": 15, \"filename\": \"banners/banner-4.jpg\"}','nl'),(135,863,'[\"reglement\"]','nl'),(136,862,'[\"page_single_column.twig\"]','nl'),(137,873,'[\"GDPR - Privacy Verklaring\"]','nl'),(138,872,'[\"<p>Uw gegevens worden verwerkt door:<br><br>Judoschool Yoshi-Kan vzw<br>Zetel: Spekstraat 80, 2220 Heist op den Berg<br>Emailadres: judo.yoshikan@gmail.com<br>Telefoon: 0474/51.13.98<br><br>Om conform te zijn met de GDPR wetgeving heeft Judoschool Yoshi-kan vzw ook een privacyverklaring. <br><a href=\\\"/privacy/privacy-verklaring\\\">Bekijk hier de laatste versie.</a>&nbsp;</p>\"]','nl'),(139,871,'[\"\"]','nl'),(140,870,'{\"0\": \"\", \"alt\": \"\", \"media\": 14, \"filename\": \"banners/banner-5.jpg\"}','nl'),(141,869,'[\"gdpr-privacy-verklaring\"]','nl'),(142,868,'[\"page_single_column.twig\"]','nl'),(143,880,'[\"Yoshi-Kan op TV in Karrewiet\"]','nl'),(144,879,'[\"<p>Karrewiet maakte een reportage over onze buitentrainingen.<br></p>\"]','nl'),(145,878,'{\"0\": \"\", \"alt\": \"\", \"media\": \"19\", \"filename\": \"\"}','nl'),(146,877,'[\"\"]','nl'),(147,876,'{\"url\": \"https://www.youtube.com/watch?v=TVvMKhXeZWo\", \"html\": \"<iframe width=\\\"200\\\" height=\\\"113\\\" src=\\\"https://www.youtube.com/embed/TVvMKhXeZWo?feature=oembed\\\" frameborder=\\\"0\\\" allow=\\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\\\" allowfullscreen title=\\\"hoe hou je afstand tijdens de judo training?\\\"></iframe>\", \"title\": \"hoe hou je afstand tijdens de judo training?\", \"width\": \"200\", \"height\": \"113\", \"authorurl\": \"https://www.youtube.com/@KarrewietvanKetnet\", \"thumbnail\": \"https://i.ytimg.com/vi/TVvMKhXeZWo/hqdefault.jpg\", \"authorname\": \"Karrewiet van Ketnet\"}','nl'),(148,875,'[false]','nl'),(149,874,'[\"yoshi-kan-op-tv-in-karrewiet\"]','nl'),(150,887,'[\"Yoshi-Kan bestaat 25 jaar!\"]','nl'),(151,886,'[\"\"]','nl'),(152,885,'{\"0\": \"\", \"alt\": \"\", \"media\": 20, \"filename\": \"nieuws/1671212099_page7-blog-entry20-flyer-v4.jpg\"}','nl'),(153,884,'{\"url\": \"\", \"html\": \"\", \"title\": \"\", \"width\": \"\", \"height\": \"\", \"authorurl\": \"\", \"thumbnail\": \"\", \"authorname\": \"\"}','nl'),(154,883,'[\"\"]','nl'),(155,882,'[false]','nl'),(156,881,'[\"yoshi-kan-bestaat-25-jaar\"]','nl'),(157,894,'[\"Kerstvakantie.\"]','nl'),(158,893,'[\"<p>Nog even en dan staat de Kerstvakantie alweer voor de deur!&nbsp;<br><strong>De judotrainingen lopen nog door tot en met vrijdag 23/12/2022 <br>en&nbsp;</strong><strong>gaan in 2023 terug van start vanaf maandag 09/01/2023.</strong></p>\\r\\n<p><strong></strong>In <strong>2023</strong> staan er reeds <strong>3 judo&nbsp;</strong><strong>toernooien</strong>&nbsp;gepland, zie onderstaande data :</p>\\r\\n<ul><li><strong>Zondag 19/02/2023 in Borgerhout</strong></li><li><strong></strong><strong>Zaterdag 25/02/2023 in Bilzen</strong></li><li><strong></strong><strong>Zondag 07/05/2023 Clubtoernooi in Haacht</strong></li></ul>\\r\\n<p><strong></strong>Noteer alvast deze data, de uitnodiging volgt in januari 2023, <br>inschrijven voor de eerste 2 tornooien kan eveneens vanaf januari 2023.</p>\\r\\n<p><strong>Wij wensen al onze judoka\'s en hun familie zeer warme, gezellige Kerstdagen toe <br>en een gezond en sportief 2023!</strong></p>\\r\\n<p>Team Yoshi-Kan.<br></p>\"]','nl'),(159,892,'{\"0\": \"\", \"alt\": \"\", \"media\": \"\", \"filename\": \"\"}','nl'),(160,891,'{\"url\": \"\", \"html\": \"\", \"title\": \"\", \"width\": \"\", \"height\": \"\", \"authorurl\": \"\", \"thumbnail\": \"\", \"authorname\": \"\"}','nl'),(161,890,'[\"\"]','nl'),(162,889,'[false]','nl'),(163,888,'[\"kerstvakantie\"]','nl');
